import React from "react";
import "./checkout.css";
import image from "./5092428.jpg";

function checkout() {
  return (
    <div className="checkout">
      <div className="checkout_left">
        <img className="checkout_img" src={image} />
      </div>
    </div>
  );
}

export default checkout;
